  input: 'TEXT,F3XA,,"Pursuant to the FEC''s letter of January 14, 2000, the committee
    did not receive this letter until February 3, 2003.  The report has been amended
    to reflect the following: the committee has a best erfforts policy in affect.  The
    original soliciation includes a clear request for the contributor information
    and informs the contributor that federal law requires reporting of such information.  If
    the information is not provided, the committee contacts the contributor again
    within 30 days.  Followup requests are done by telephone or in writing.  The missing
    information is clearly requseted and no solicitation is included.  Contributor
    is informed again that the federal law requires the reporting of this information  and
    if the request is done in writing a pre-addressed return envelope is enclosed.  If
    the contributor information is recieved, the applicable report is amended with
    the new information.    Additoinally, the election designation has been added
    to all contributions."'
